// Minor cleanup
// Additional move on branch
static uint32_t Height, Width, Spacing;
static uint8_t *Matrix_p;

void LCD_SelectFont(uint32_t FontHeight, uint32_t FontWidth, uint32_t CharSpacing, uint8_t *FontMatrix_p)
{
	Height = 	FontHeight;
	Width = 	FontWidth;
	Spacing = 	CharSpacing;
	Matrix_p = 	FontMatrix_p;
}

uint32_t LCD_DrawChar(uint32_t Xpos, uint32_t Ypos, uint8_t nr_to_display)
{
	uint32_t x, y;
	uint32_t BytePerHeight;
	uint8_t *char_p;
	uint8_t mask;
	uint32_t CharWidthFromMatrix;
	uint32_t TextColor, BackgroundColor;

	BackgroundColor = BSP_LCD_GetBackColor();
	TextColor = BSP_LCD_GetTextColor();

	BytePerHeight = (Height + 7) / 8;
	CharWidthFromMatrix = Matrix_p[nr_to_display * (1 + (BytePerHeight * Width))];
	char_p = &Matrix_p[1 + (nr_to_display * (1 + (BytePerHeight * Width)))];

	if (CharWidthFromMatrix > Width)
	{
		return 0xFFFFFFFF; // invalid width of the char taken from the Font Matrix
	}

	for(x = 0; x < CharWidthFromMatrix; x++)
	{
		for (y = 0; y < Height; y++)
		{
			mask = 1 << (y % 8);
			if (char_p[(x * BytePerHeight) + (y / 8)] & mask)
			{
				BSP_LCD_DrawPixel(x + Xpos, y + Ypos, TextColor);
			} else {
				BSP_LCD_DrawPixel(x + Xpos, y + Ypos, BackgroundColor);
			}
		}
	}

	BSP_LCD_SetTextColor(BSP_LCD_GetBackColor());
	BSP_LCD_FillRect(Xpos + CharWidthFromMatrix, Ypos, Spacing, Height);
	BSP_LCD_SetTextColor(TextColor);

	return ( CharWidthFromMatrix + Spacing );
}

uint32_t LCD_DrawTextLine(uint32_t Xpos, uint32_t Ypos, uint8_t *Text_p, uint8_t NrCharsToDraw)
{
	uint32_t NewXpos = Xpos;
	uint32_t XposIncrement;
	uint8_t i;

	for (i = 0; i < NrCharsToDraw; i++)
	{
		XposIncrement = LCD_DrawChar(NewXpos, Ypos, Text_p[i]);
		if (XposIncrement == 0xFFFFFFFF)
		{
			return 0xFFFFFFFF; //error
		}
		NewXpos += XposIncrement;
	}

	return NewXpos;
}
